    false,nt"url": null,nt"notes": "The OpenRECORDS data set consists of FOIL
    Request identifying information and the responses posted by agency FOIL officers
    to fulfill requests.rnrnThe current version is a u201ctestu201d model. You can file
    a FOIL request for any New York City agency and those that are not participating
    in this launch will respond to your request using their current FOIL process. Participating
    agencies will use the portal to track and respond to FOIL requests. The agencies
    currently participating are: Office of the Mayor, Department of Information Technology
    and Telecommunications, Department of Records and Information Services, Department
    of Education, Office of Administrative Trials and Hearings, NYC Emergency Management,
